import React, { useContext } from 'react';
import StarWarContext from '../context/StarWarContext';
// import { requestAPIAxios, requestAPI } from '../service/requestAPI';

export default function Table() {
  const { data } = useContext(StarWarContext);

  const [DATA, setData] = useState([]);
  const [filters, setFilters] = useState({});

  useEffect(() => {
    reqApiFetch().then((response) => setData(response));
  }, []);

  const value = useMemo(() => ({
    data,
    filters,
    setFilters,
  }), [DATA, filters, setFilters]);

  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Rotation Period</th>
          <th>Orbital Period</th>
          <th>Diameter</th>
          <th>Climate</th>
          <th>Gravity</th>
          <th>Terrain</th>
          <th>Surface Water</th>
          <th>Population</th>
          <th>Films</th>
          <th>Created</th>
        </tr>
      </thead>
      <tbody>
        {
          data.map((qq) => (
            <tr key={ qq.id }>
              <td>{ qq.name }</td>
              <td>{ qq.rotation_period }</td>
              <td>{ qq.orbital_period }</td>
              <td>{ qq.diameter }</td>
              <td>{ qq.climate }</td>
              <td>{ qq.gravity }</td>
              <td>{ qq.terrain }</td>
              <td>{ qq.surface_water }</td>
              <td>{ qq.population }</td>
              <td>{ qq.films }</td>
              <td>{ qq.created }</td>
            </tr>
          ))
        }
      </tbody>
    </table>
  );
}
